import './App.css';

const NewsComponents = () => {
    return (
       <div className="bar">
            <div className="block-all">
                <div className="icon"></div>
                <div className="name"></div>
            </div>
            <div className>
                <div className="text"></div>
                <div className="text-2"></div>
                <div ClassName="text-2"></div>
            </div>
       </div>
    )
}

export default NewsComponents;
